B.aO5=new A.ch("Electronics and Telecommunication Engineering undergraduate at \n          University of Moratuwa with a strong academic \n          record (GPA 3.95/4.0) and a passion for solving real-world problems \n          through innovative hardware and software solutions. Interested in \n          embedded systems, FPGA design, and analog and digital design. Also an \n          accomplished hockey player and orchestral musician.",null,B.aMz,B.dH,null,null,null,null,null,null,null)
B.YT=new A.pY("\ud83d\udc68\u200d\ud83c\udf93 Education","assets/images/uom.jpeg","I'm currently an undergraduate student in Electronic and Telecommunication Engineering at the University of Moratuwa. I actively contribute to both academic and extracurricular spheres\u2014from hands-on electronics, robotics, and AI projects to leadership roles in clubs and societies. I\u2019ve led and participated in national-level competitions, collaborative tech innovations, and organizational committees that bring students together around shared passions.",!1,null)
B.YU=new A.pY("\ud83c\udfeb School Journey","assets/images/school.JPG","My foundation was laid at Visakha Vidyalaya, where I first developed a deep interest in both science and the arts. I was actively involved in prefects guilds, school band, hockey and montaineering teams, and societies. I served as the School Head Prefect and graduated with a strong academic and leadership record.",!0,null)
B.YV=new A.pY("\ud83c\udfb5 Music","assets/images/music4.jpeg","Music has always been a big part of my life. As an instrumentalist, I've found a second voice through music. I play the clarinet in the Colombo Wind Orchestra and the Junior Symphony Orchestra, and I regularly perform for university events. My musical talents extend to the piano, drums, and violin, and I've also composed a few original pieces as I explore music. Music has been not just a passion but a way to express creativity and build community through performance.",!1,null)
B.YW=new A.pY("\ud83c\udfd1 Hockey","assets/images/hockey.jpeg","Playing as an attacker in my school and university hockey teams taught me teamwork, discipline, and resilience under pressure. I'm a proud representative of the Sri Lanka Universities Hockey Team, having competed at the Junior National Hockey Championship in both 2023 and 2024. I also played for the University of Moratuwa at the Sri Lanka University Games (2023) and Inter-University Games (2024), earning University Colors in 2023 and 2024 for my outstanding performance and commitment to the sport.",!0,null)
